E_D("replace into `p_selfform` values('2','a3a7daf71176d5b','景点预订','景点预订','青岛海底世界位于青岛汇泉湾畔，毗邻青岛著名风景区鲁迅公园和第一海水浴场。它整合了青岛水族馆、标本馆、淡水鱼馆等原有旅游资源，与依山傍海的自然美景相融合，形成山中有海的奇景。独特的地理位置、现代化的展示手段、与水族馆、标本馆、淡水鱼馆的良好整合和互补，使其成为全国独具特色海洋生态大观园。','&lt;p&gt;\r\n	&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;　整个青岛&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5394219.html&quot; target=&quot;_blank&quot;&gt;海底世界&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;被&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5373982.html&quot; target=&quot;_blank&quot;&gt;礁石&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;环绕，形成山中有海的美景。独特的&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/6571838.html&quot; target=&quot;_blank&quot;&gt;地理位置&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;、现代化的展示手段、与&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5039362.html&quot; target=&quot;_blank&quot;&gt;水族馆&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;、标本馆、&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/448225.html&quot; target=&quot;_blank&quot;&gt;淡水鱼&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;馆的良好整合和互补，使其成为全国独具特色海洋生态大观园。集海底观光旅游与海洋科普教育于一体，并创下两个世界第一和多项全国第一：拥有世界上目前最大的单体亚克力圆柱展缸、世界&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/6293864.html&quot; target=&quot;_blank&quot;&gt;海洋馆&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;中展示种类最为齐全的海洋标本馆；是国内惟一一家拥有开放式实验室的海底世界，国内第一家从国外引进荧光壁画的海底世界，国内首家采用180度常规视窗、254度大视窗和360度圆柱视窗等多种形式相结合的&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5718024.html&quot; target=&quot;_blank&quot;&gt;海底隧道&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;结构的海底世界。其精心的设计与依山傍海的自然风貌相融合，形成了青岛黄金海岸上一道独特的亮丽&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5660554.html&quot; target=&quot;_blank&quot;&gt;风景线&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/uploads/a/a3a7daf71176d5b/8/d/a/7/539553ae261f4.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;青岛海底世界位于青岛莱阳路2号，毗邻青岛著名风景区&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5380241.html&quot; target=&quot;_blank&quot;&gt;鲁迅公园&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;和第一海水浴场，总建筑面积7000平方米，水体4000吨，是由&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5621129.html&quot; target=&quot;_blank&quot;&gt;青岛水族馆&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;和山东鲁信投资集团有限公司共同投资开发的现代大型海洋生态旅游项目，总投资达2.2亿元。 青岛海底世界主要由潮间带、&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5718024.html&quot; target=&quot;_blank&quot;&gt;海底隧道&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;和地下四层观光建筑三大部分构成，展示部分完全在地下。潮间带长35米；海底隧道长86.2米，宽2.5米，隧道拱形玻璃的弧度采用180度的常规角度、254度大角度、360度&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5362907.html&quot; target=&quot;_blank&quot;&gt;圆柱&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;水体及窗式玻璃等多种形式相结合的造型结构，行走在隧道中，便如同置身于&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/2969796.html&quot; target=&quot;_blank&quot;&gt;海底&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;，大大小小的鱼儿在身边游弋，还能看到人鲨共舞的场面；地下四层有高达7.6米，亚洲目前最大的单体圆柱展示水缸，展示一些珍贵的&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5378310.html&quot; target=&quot;_blank&quot;&gt;珊瑚&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;礁生物。整个青岛海底世界被礁石环绕，形成山中有海的美景。独特的地理位置、现代化的展示手段、与&lt;/span&gt;&lt;a href=&quot;http://baike.so.com/doc/5039362.html&quot; target=&quot;_blank&quot;&gt;水族馆&lt;/a&gt;&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;、标本馆、淡水鱼馆的良好整合和互补，使其成为全国独具特色海洋生态大观园。 青岛海底世界集海底观光旅游和海洋科普教育为一体，填补了山东省海底世界项目的空白，并创下多项全国第一，形成了青岛黄金海岸线上一道独特的亮丽风景线，是全国独具特色的海洋生态大观园。&lt;/span&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;line-height:24px;font-family:tahoma, arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/uploads/a/a3a7daf71176d5b/1/0/c/a/539553f26eddd.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;/span&gt; \r\n&lt;/p&gt;','1402295286','提交成功','提交失败','1404230399','http://v.24so.com/uploads/a/a3a7daf71176d5b/5/6/c/9/thumb_539550c98cb1b.jpg');");
